import './Array.css'

const arrays = [
    {
        id: 1,
        title: 'Hello world',
        text: 'Lorem ipsum dolor'
    },
    {
        id: 2,
        title: 'Hello world',
        text: 'Lorem ipsum dolor'
    },
    {
        id: 3,
        title: 'Why Do You Use That',
        text: 'Lorem ipsum'
    }
];

const ArrayList = arrays.map(
    (array) => 
    <div key = {array.id} className="element">
        <div className="title">
            <h1>{array.title}</h1>
        </div>

        <div className="text">
            <p>{array.text}</p>
        </div>
    </div>
);

function Array(){
    return(
        <div className = "block">
            {ArrayList}
        </div>
    );
}

export default Array
